    protected function register_controls() {

        // --- Content Tab: Text & Link ---
        $this->start_controls_section(
            'section_content_text',
            [
                'label' => esc_html__('Content', 'mh-plug'),
                'tab' => Controls_Manager::TAB_CONTENT,
            ]
        );

        $this->add_control(
            'primary_text',
            [
                'label' => esc_html__('Primary Text', 'mh-plug'),
                'type' => Controls_Manager::TEXT,
                'default' => esc_html__('1 - 2', 'mh-plug'),
                'dynamic' => ['active' => true],
            ]
        );

        $this->add_control(
            'secondary_text',
            [
                'label' => esc_html__('Secondary Text', 'mh-plug'),
                'type' => Controls_Manager::TEXT,
                'default' => esc_html__('years', 'mh-plug'),
                'dynamic' => ['active' => true],
            ]
        );

        $this->add_control(
            'link',
            [
                'label' => esc_html__('Link', 'mh-plug'),
                'type' => Controls_Manager::URL,
                'placeholder' => esc_html__('https://your-link.com', 'mh-plug'),
                'dynamic' => ['active' => true],
            ]
        );

        $this->add_responsive_control(
            'align',
            [
                'label' => esc_html__('Alignment', 'mh-plug'),
                'type' => Controls_Manager::CHOOSE,
                'options' => [
                    'flex-start' => [
                        'title' => esc_html__('Left', 'mh-plug'),
                        'icon' => 'eicon-text-align-left',
                    ],
                    'center' => [
                        'title' => esc_html__('Center', 'mh-plug'),
                        'icon' => 'eicon-text-align-center',
                    ],
                    'flex-end' => [
                        'title' => esc_html__('Right', 'mh-plug'),
                        'icon' => 'eicon-text-align-right',
                    ],
                ],
                'default' => 'center',
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-content' => 'align-items: {{VALUE}};', 
                ],
            ]
        );
        
        $this->add_responsive_control(
            'text_align',
            [
                'label' => esc_html__( 'Text Align', 'mh-plug' ),
                'type' => Controls_Manager::CHOOSE,
                'options' => [
                    'left' => [
                        'title' => esc_html__( 'Left', 'mh-plug' ),
                        'icon' => 'eicon-text-align-left',
                    ],
                    'center' => [
                        'title' => esc_html__( 'Center', 'mh-plug' ),
                        'icon' => 'eicon-text-align-center',
                    ],
                    'right' => [
                        'title' => esc_html__( 'Right', 'mh-plug' ),
                        'icon' => 'eicon-text-align-right',
                    ],
                ],
                'default' => 'center',
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-content' => 'text-align: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_section();

        // --- Style Tab: Brush Shape ---
        $this->start_controls_section(
            'section_style_brush_shape',
            [
                'label' => esc_html__('Brush Shape', 'mh-plug'),
                'tab' => Controls_Manager::TAB_STYLE,
            ]
        );

        // --- ADDED TABS ---
        $this->start_controls_tabs( 'tabs_brush_style' );

        // --- NORMAL TAB ---
        $this->start_controls_tab(
            'tab_brush_normal',
            [
                'label' => esc_html__( 'Normal', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'brush_color',
            [
                'label' => esc_html__('Brush Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'default' => '#ecd3cb', // Default color from your SVG
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-svg path' => 'fill: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();

        // --- HOVER TAB ---
        $this->start_controls_tab(
            'tab_brush_hover',
            [
                'label' => esc_html__( 'Hover', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'brush_color_hover',
            [
                'label' => esc_html__('Brush Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'selectors' => [
                    // Target the wrapper on hover
                    '{{WRAPPER}} .mh-brush-text-wrapper:hover .mh-brush-text-svg path' => 'fill: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();
        $this->end_controls_tabs();
        // --- END TABS ---

        $this->add_control(
            'brush_style_divider',
            [
                'type' => Controls_Manager::DIVIDER,
                'style' => 'thick',
            ]
        );

        $this->add_responsive_control(
            'brush_width',
            [
                'label' => esc_html__('Width', 'mh-plug'),
                'type' => Controls_Manager::SLIDER,
                'range' => [
                    'px' => ['min' => 50, 'max' => 1000],
                    '%' => ['min' => 10, 'max' => 200],
                ],
                'default' => ['unit' => '%', 'size' => 100],
                'size_units' => ['px', '%', 'vw'],
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-wrapper' => 'width: {{SIZE}}{{UNIT}};',
                ],
            ]
        );
        
        $this->add_responsive_control(
            'brush_height',
            [
                'label' => esc_html__('Height', 'mh-plug'),
                'type' => Controls_Manager::SLIDER,
                'range' => [
                    'px' => ['min' => 50, 'max' => 1000],
                ],
                'default' => ['unit' => 'px', 'size' => 180],
                'size_units' => ['px', 'vh', 'em'],
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-wrapper' => 'height: {{SIZE}}{{UNIT}};',
                ],
            ]
        );

        $this->add_responsive_control(
            'content_padding',
            [
                'label' => esc_html__('Content Padding', 'mh-plug'),
                'type' => Controls_Manager::DIMENSIONS,
                'size_units' => [ 'px', '%', 'em' ],
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-content' => 'padding: {{TOP}}{{UNIT}} {{RIGHT}}{{UNIT}} {{BOTTOM}}{{UNIT}} {{LEFT}}{{UNIT}};',
                ],
                'description' => esc_html__('Adjust the padding for the text *inside* the brush shape.', 'mh-plug'),
            ]
        );

        // --- ADDED TRANSITION CONTROL ---
        $this->add_control(
            'hover_transition',
            [
                'label' => esc_html__( 'Transition Duration', 'mh-plug' ),
                'type' => Controls_Manager::SLIDER,
                'range' => [
                    'ms' => [
                        'min' => 0,
                        'max' => 3000, // 3 seconds
                        'step' => 100,
                    ],
                ],
                'default' => [
                    'unit' => 'ms',
                    'size' => 300, // 0.3 seconds
                ],
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-wrapper, {{WRAPPER}} .mh-brush-text-svg path, {{WRAPPER}} .mh-brush-primary-text, {{WRAPPER}} .mh-brush-secondary-text' => 'transition: all {{SIZE}}{{UNIT}} ease;',
                ],
                'separator' => 'before',
            ]
        );

        $this->end_controls_section();


        // --- Style Tab: Primary Text ---
        $this->start_controls_section(
            'section_style_primary_text',
            [
                'label' => esc_html__('Primary Text', 'mh-plug'),
                'tab' => Controls_Manager::TAB_STYLE,
            ]
        );

        // --- ADDED TABS ---
        $this->start_controls_tabs( 'tabs_primary_text_style' );

        // --- NORMAL TAB ---
        $this->start_controls_tab(
            'tab_primary_text_normal',
            [
                'label' => esc_html__( 'Normal', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'primary_text_color',
            [
                'label' => esc_html__('Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'default' => '#000000',
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-primary-text' => 'color: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();

        // --- HOVER TAB ---
        $this->start_controls_tab(
            'tab_primary_text_hover',
            [
                'label' => esc_html__( 'Hover', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'primary_text_color_hover',
            [
                'label' => esc_html__('Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-wrapper:hover .mh-brush-primary-text' => 'color: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();
        $this->end_controls_tabs();
        // --- END TABS ---

        $this->add_group_control(
            Group_Control_Typography::get_type(),
            [
                'name' => 'primary_text_typography',
                'selector' => '{{WRAPPER}} .mh-brush-primary-text',
                'separator' => 'before',
            ]
        );
        
        $this->add_group_control(
            Group_Control_Text_Shadow::get_type(),
            [
                'name' => 'primary_text_shadow',
                'selector' => '{{WRAPPER}} .mh-brush-primary-text',
            ]
        );

        $this->add_responsive_control(
            'primary_text_spacing',
            [
                'label' => esc_html__('Bottom Spacing', 'mh-plug'),
                'type' => Controls_Manager::SLIDER,
                'range' => ['px' => ['min' => 0, 'max' => 100]],
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-primary-text' => 'margin-bottom: {{SIZE}}{{UNIT}};',
                ],
            ]
        );

        $this->end_controls_section();

        // --- Style Tab: Secondary Text ---
        $this->start_controls_section(
            'section_style_secondary_text',
            [
                'label' => esc_html__('Secondary Text', 'mh-plug'),
                'tab' => Controls_Manager::TAB_STYLE,
            ]
        );

        // --- ADDED TABS ---
        $this->start_controls_tabs( 'tabs_secondary_text_style' );

        // --- NORMAL TAB ---
        $this->start_controls_tab(
            'tab_secondary_text_normal',
            [
                'label' => esc_html__( 'Normal', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'secondary_text_color',
            [
                'label' => esc_html__('Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'default' => '#000000',
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-secondary-text' => 'color: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();

        // --- HOVER TAB ---
        $this->start_controls_tab(
            'tab_secondary_text_hover',
            [
                'label' => esc_html__( 'Hover', 'mh-plug' ),
            ]
        );

        $this->add_control(
            'secondary_text_color_hover',
            [
                'label' => esc_html__('Color', 'mh-plug'),
                'type' => Controls_Manager::COLOR,
                'selectors' => [
                    '{{WRAPPER}} .mh-brush-text-wrapper:hover .mh-brush-secondary-text' => 'color: {{VALUE}};',
                ],
            ]
        );

        $this->end_controls_tab();
        $this->end_controls_tabs();
        // --- END TABS ---

        $this->add_group_control(
            Group_Control_Typography::get_type(),
            [
                'name' => 'secondary_text_typography',
                'selector' => '{{WRAPPER}} .mh-brush-secondary-text',
                'separator' => 'before',
            ]
        );
        
        $this->add_group_control(
            Group_Control_Text_Shadow::get_type(),
            [
                'name' => 'secondary_text_shadow',
                'selector' => '{{WRAPPER}} .mh-brush-secondary-text',
            ]
        );

        $this->end_controls_section();
    }

    /**
     * Render widget output on the frontend.
     */
    protected function render() {
        $settings = $this->get_settings_for_display();
        
        $wrapper_tag = 'div';
        $wrapper_attrs_string = 'class="mh-brush-text-wrapper"';

        if ( ! empty( $settings['link']['url'] ) ) {
            $wrapper_tag = 'a';
            $this->add_link_attributes( 'link_wrapper', $settings['link'] );
            $wrapper_attrs_string = $this->get_render_attribute_string( 'link_wrapper' );
            if (strpos($wrapper_attrs_string, 'class="') !== false) {
                 $wrapper_attrs_string = str_replace( 'class="', 'class="mh-brush-text-wrapper ', $wrapper_attrs_string );
            } else {
                 $wrapper_attrs_string .= ' class="mh-brush-text-wrapper"';
            }
        }
        ?>
        <<?php echo $wrapper_tag; ?> <?php echo $wrapper_attrs_string; ?>>
            
            <div class="mh-brush-text-svg">
                <svg viewBox="0 0 400 291.96581196581195" preserveAspectRatio="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="<?php echo $this->get_brush_svg_path(); ?>" />
                </svg>
            </div>

            <div class="mh-brush-text-content">
                <?php if ( ! empty( $settings['primary_text'] ) ) : ?>
                    <span class="mh-brush-primary-text">
                        <?php echo wp_kses_post( $settings['primary_text'] ); ?>
                    </span>
                <?php endif; ?>
                
                <?php if ( ! empty( $settings['secondary_text'] ) ) : ?>
                    <span class="mh-brush-secondary-text">
                        <?php echo wp_kses_post( $settings['secondary_text'] ); ?>
                    </span>
                <?php endif; ?>
            </div>

        </<?php echo $wrapper_tag; ?>>
        <?php
    }

    /**
     * Render widget output in the editor (backend).
     */
    protected function _content_template() {
        // We get the path data once using PHP and inject it into the JS template
        $svg_path_data = $this->get_brush_svg_path();
        ?>
        <#
            var wrapperTag = 'div';
            var wrapperAttrs = 'class="mh-brush-text-wrapper"';

            if ( settings.link.url ) {
                wrapperTag = 'a';
                wrapperAttrs = 'href="' + settings.link.url + '" ' + wrapperAttrs;
                if ( settings.link.is_external ) {
                    wrapperAttrs += ' target="_blank"';
                }
                if ( settings.link.nofollow ) {
                    wrapperAttrs += ' rel="nofollow"';
                }
            }
            
            // This is the SVG path data, safely injected from PHP
            var svg_path = "<?php echo esc_js( $svg_path_data ); ?>";
        #>
        
        <{{{ wrapperTag }}} {{{ wrapperAttrs }}}>
            
            <div class="mh-brush-text-svg">
                <svg viewBox="0 0 400 291.96581196581195" preserveAspectRatio="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="{{{ svg_path }}}" />
                </svg>
            </div>
            
            <div class="mh-brush-text-content">
                <# if ( settings.primary_text ) { #>
                    <span class-="mh-brush-primary-text">
                        {{{ settings.primary_text }}}
                    </span>
                <# } #>
                
                <# if ( settings.secondary_text ) { #>
                    <span class="mh-brush-secondary-text">
                        {{{ settings.secondary_text }}}
                    </span>
                <# } #>
            </div>
            
        </{{{ wrapperTag }}}>
        <?php
    }
}